import logo from './logo.svg';
import React from 'react';
import './index.css';

function JoinLastName({firstName , lastName}){
    return firstName + "-" + lastName;
}

const person = {
    firstName: "Dare",
    lastName: "Oyekunle"
}

function JoinName() {
  return (
    <div className='container justify-center items-center grid'>
      <h1 className='text-green-700 text-3xl font-extrabold'>{JoinLastName(person)}</h1>
    </div>
  );
}
export default JoinName;
